window.bookSummaryJSON = "<p>Ah, Nyil, with its magic, its monsters, and its petty gods. A divine spat leaves French medic Viv stranded in the middle of an arcane disaster zone crawling with undead horrors. Thankfully, there are strange allies to be found, not least the mysterious interface that helps humans survive in this merciless world.</p> <p>Viv will have to progress fast to survive this calamity and find civilisation. She will also need a bit of luck. Unless, of course, she becomes the calamity herself. After all, luck is such a fickle thing.</p>"; 
